Description:
            Our singled sided Luggage tags “bag-tagz” are personalized and embroidered for your luggage, backpack, gym bag, camera bag or any bag you need to personalize.  How often have you been to the airport or cruise port and not been able to easily find your luggage going around (and around) that carousel or in that sea of bags at the cruise port?  Even in the overhead compartment of the plane.   Bag-Tagz solve that problem.  
  These make great gifts for weddings, showers, graduation, team gifts, teacher gifts, and are a must have for travelers.  Use it for musical instruments, lunch bags, purses, computer cases, sports bags, beach bags, or any other type of bag that you might want to identify or jazz up. Put it on your stroller for easy identification at the park or theme park.
  Our tags are made of the heavy duty  Webbing which is UV, water and mildew resistant.  The tags have a screw lock stainless cable ring which attaches securely to the luggage handle or strap. 
  The maximum number of character is 15 (including spaces.)  For longer names, we use a compact font to fit the letters in the required space. The more letters, the more condensed the look. Please contact us with any questions. 
Dimensions:  7 “x 1 ½ “  
Web colors: pink,  yellow, orange, black and teal.  New Colors added : Neon Yellow, Vibrant Blue, Fluorescent Pink, Red Hot Orange, Shocking Green
Thread colors:  white, dark blue, black, red, pink, shocking Pink, gold and yellow. 
Font choices: Blackboard, Bamboo, Comic Sans, Chicago, Hand of Sean, Racer, Child's Play, Tahoma, Brush Script, Drifter, Energy
When you check out please indicate the name for your tag and the font style. IF YOU DO NOT TELL US YOUR PREFERRED FONT WE WILL AUTOMATICALLY USE  "TAHOMA"
IF YOU ORDER MORE THAN 30 - ENTER CODE 20OFF30ANDMORE  AT CHECKOUT FOR SAVINGS OF 20%
