            Magnet alphabet Felt letter Alphabet letters Refrigerator magnets Home decor magnet Preschool learning toy Stuffed letters Kids gift toddler Nursery letters Name letters
Felt alphabet with magnets inside. This is a bright and useful educational toy for children.
Use these soft letters:
- for learning the ABC with your kid;
- for learning your children to read;
- for training spelling;
- for composing different words;
- for making garlands and banners;
- for sending sweet messages to each other on a fridge or a magnet board etc.
The letters are:
- shining and attractive;
- tight and comfortable to use;
- with magnets inside (you can put them on a fridge and a magnet board for better memorizing or even for decorative purpose);
- quite big;
- can be pinned by pegs to a cord to make the name banner for your kid (a cord and pegs are included; just add the name to the “Note to seller”);
- packed to the storage bag.
One letter is about 7 cm (2 3/4") height.
Choose from the drop-down menu:
- an alphabet (26 letters);
- an alphabet and additional high-frequency letters (2634 letters=60 letters);
Need name garland or only a few letters? Please, look here
https://www.etsy.com/listing/481241307/magnet-letters-name-garland-soft-letters?ref=shop_home_active_1

You can also make a custom order in another color palette.
About high-frequency letters. There was a problem with the quantity of letters when I taught my daughter to read. We’d like to compose the word “dad”, but there is only one letter “d” at the standard alphabet set. The same for the words “mum”, “good”, “people” and many others. So I decided to make an alphabet with additional letters. These are high-frequency letters used in many high-frequency words.
So I additionally sew 34 letters:
- “E” – 3 letters;
- “A” – 2 letters;
- “I” – 2 letters;
- “O” – 2 letters;
- “U” – 1 letter;
- “T” – 3 letters;
- “N” – 3 letters;
- “S” – 2 letters;
- “H” – 2 letters;
- “R” – 2 letters”
- “D” – 2 letters;
- “L” – 1 letter;
- “M” – 2 letters;
- “C” – 2 letters;
- “W” – 1 letter;
- “F” – 1 letter;
- “G” – 1 letter;
- “Y” – 1 letter;
- “P” – 1 letter.
